import numpy as np

def poly_eval(coeffs, x):
    """
    Evaluate a polynomial given its coefficients at a specific value of x.

    Parameters:
        coeffs (list): List of coefficients of the polynomial, starting from the highest degree term.
        x (float): Value at which the polynomial needs to be evaluated.

    Returns:
        float: Value of the polynomial at x.
    """
    result = 0
    n = len(coeffs)
    for coeff in reversed(coeffs):
        result = result * x + coeff
    return result

def poly_roots(coeffs, tol=1e-6):
    """
    Find the roots of a polynomial using numpy's roots function.

    Parameters:
        coeffs (list): List of coefficients of the polynomial, starting from the highest degree term.
        tol (float): Tolerance level for considering a root.

    Returns:
        list: List of roots of the polynomial.
    """
    return np.roots(coeffs)

def poly_samples(coeffs, x_values):
    """
    Evaluate a polynomial at multiple x values using divide and conquer approach.

    Parameters:
        coeffs (list): List of coefficients of the polynomial, starting from the highest degree term.
        x_values (list): List of x values at which the polynomial needs to be evaluated.

    Returns:
        list: List of values of the polynomial at specified x values.
    """
    return [poly_eval(coeffs, x) for x in x_values]

