def poly_coefficients_add(coeffs1, coeffs2):
    """
    Add two polynomials given their coefficients.

    Parameters:
        coeffs1 (list): Coefficients of the first polynomial.
        coeffs2 (list): Coefficients of the second polynomial.

    Returns:
        list: Coefficients of the polynomial obtained by adding coeffs1 and coeffs2.
    """
    len1 = len(coeffs1)
    len2 = len(coeffs2)
    max_len = max(len1, len2)
    if len1 < len2:
        coeffs1 = [0] * (len2 - len1) + coeffs1
    elif len2 < len1:
        coeffs2 = [0] * (len1 - len2) + coeffs2
    return [c1 + c2 for c1, c2 in zip(coeffs1, coeffs2)]


def poly_samples(coeffs1, coeffs2, x_values):
    """
    Evaluate the sum of two polynomials at multiple x values.

    Parameters:
        coeffs1 (list): Coefficients of the first polynomial.
        coeffs2 (list): Coefficients of the second polynomial.
        x_values (list): List of x values at which the polynomials need to be evaluated.

    Returns:
        list: List of values of the sum of the polynomials at specified x values.
    """
    result = []
    for x in x_values:
        result.append(poly_eval(coeffs1, x) + poly_eval(coeffs2, x))
    return result

