import numpy as np

def poly_eval(coeffs, x):
    """
    Evaluate a polynomial given its coefficients at a specific value of x.

    Parameters:
        coeffs (list): List of coefficients of the polynomial, starting from the highest degree term.
        x (float): Value at which the polynomial needs to be evaluated.

    Returns:
        float: Value of the polynomial at x.
    """
    result = 0
    n = len(coeffs)
    for coeff in reversed(coeffs):
        result = result * x + coeff
    return result

def poly_coefficients_multiply(coeffs1, coeffs2):
    """
    Multiply two polynomials given their coefficients.

    Parameters:
        coeffs1 (list): Coefficients of the first polynomial.
        coeffs2 (list): Coefficients of the second polynomial.

    Returns:
        list: Coefficients of the polynomial obtained by multiplying coeffs1 and coeffs2.
    """
    degree1 = len(coeffs1) - 1
    degree2 = len(coeffs2) - 1
    product_degree = degree1 + degree2
    product_coeffs = [0] * (product_degree + 1)

    for i in range(degree1 + 1):
        for j in range(degree2 + 1):
            product_coeffs[i + j] += coeffs1[i] * coeffs2[j]

    return product_coeffs

def poly_roots_multiply(roots1, roots2):
    """
    Multiply two polynomials given their roots.

    Parameters:
        roots1 (array-like): Roots of the first polynomial.
        roots2 (array-like): Roots of the second polynomial.

    Returns:
        array: Roots of the polynomial obtained by multiplying roots1 and roots2.
    """
    return np.convolve(roots1, roots2)

def poly_samples_multiply(coeffs1, coeffs2, x_values):
    """
    Evaluate the product of two polynomials at multiple x values.

    Parameters:
        coeffs1 (list): Coefficients of the first polynomial.
        coeffs2 (list): Coefficients of the second polynomial.
        x_values (list): List of x values at which the polynomials need to be evaluated.

    Returns:
        list: List of values of the product of the polynomials at specified x values.
    """
    result = []
    for x in x_values:
        result.append(poly_eval(coeffs1, x) * poly_eval(coeffs2, x))
    return result

