"""#Roots of Unity

![image.png](data:image/png;base64,)
"""

import numpy as np
import matplotlib.pyplot as plt

def roots_of_unity(n):
    # Initialize an empty list to store the roots
    roots = []

    # Compute the angle increment
    angle_increment = 2 * np.pi / n

    # Compute the roots
    for k in range(n):
        # Compute the complex number representing the k-th root
        root = np.exp(1j * k * angle_increment)
        roots.append(root)

    return roots

def plot_roots(roots):
    # Extract the real and imaginary parts of the roots
    real_parts = [np.real(root) for root in roots]
    imag_parts = [np.imag(root) for root in roots]

    # Plot the roots on a unit circle
    plt.figure(figsize=(8, 8))
    plt.scatter(real_parts, imag_parts, color='blue')
    plt.plot([0], [0], marker='o', markersize=8, color='red')  # Plot origin
    plt.axis('equal')
    plt.xlabel('Real')
    plt.ylabel('Imaginary')
    plt.title('Roots of Unity')
    plt.grid(True)
    plt.show()

# Number of roots (change this value to get different orders)
n = 8

# Compute the number of roots
num_roots = 2**(n - 1)

# Compute roots of unity
roots = roots_of_unity(num_roots)
print(len(roots))

# Plot roots
plot_roots(roots)

