import numpy as np

def discrete_fourier_transform(x):
    N = len(x)
    n = np.arange(N)
    k = n.reshape((N, 1))
    e = np.exp(-2j * np.pi * k * n / N)
    return np.dot(e, x)

# Example input signal
x = np.array([0, 1, 2, 3])

# Compute DFT
dft_result = discrete_fourier_transform(x)
print("DFT Result:", dft_result)

"""#Fast Fourier Transform (FFT)"""

import numpy as np

def fft(x):
    N = len(x)
    if N <= 1:
        return x
    else:
        even = fft(x[::2])
        odd = fft(x[1::2])
        factor = np.exp(-2j * np.pi * np.arange(N) / N)
        return np.concatenate([even + factor[:N//2] * odd, even + factor[N//2:] * odd])

# Example input signal
x = np.array([0, 1, 2, 3])

# Compute FFT
fft_result = fft(x)
print("FFT Result:", fft_result)

