"""#Discrete Inverse Fourier Transform (DIFT):

![image.png](data:image/png;base64,)
"""

import numpy as np

def inverse_discrete_fourier_transform(X):
    N = len(X)
    n = np.arange(N)
    k = n.reshape((N, 1))
    W = np.exp(2j * np.pi * k * n / N)
    return np.dot(W, X) / N

# Example frequency domain representation (modify as needed)
X = np.array([1, 2, 3, 4])

# Compute Discrete Inverse Fourier Transform
x_n = inverse_discrete_fourier_transform(X)
print("Discrete Inverse Fourier Transform:", x_n)

"""#Short-Time Fourier Transform (STFT)

![image.png](data:image/png;base64,)
"""

import numpy as np
from scipy.signal import spectrogram

def stft(x, fs=1.0, window='hann', nperseg=256, noverlap=None):
    f, t, Zxx = spectrogram(x, fs=fs, window=window, nperseg=nperseg, noverlap=noverlap)
    return t, f, Zxx

# Example input signal (modify as needed)
t = np.linspace(0, 10, 1000)
