import numpy as np

def fft_multiply_polynomials(polynomial1, polynomial2):
    # Pad polynomials to the next power of 2
    N = len(polynomial1) + len(polynomial2) - 1
    next_pow_of_2 = 2 ** int(np.ceil(np.log2(N)))
    padded_poly1 = np.pad(polynomial1, (0, next_pow_of_2 - len(polynomial1)))
    padded_poly2 = np.pad(polynomial2, (0, next_pow_of_2 - len(polynomial2)))

    # Compute FFT of the padded polynomials
    fft_poly1 = np.fft.fft(padded_poly1)
    fft_poly2 = np.fft.fft(padded_poly2)

    # Element-wise multiplication in the frequency domain
    fft_result = fft_poly1 * fft_poly2

    # Compute the inverse FFT to get the product of the polynomials
    polynomial_product = np.fft.ifft(fft_result).real

    # Remove padding and round to avoid numerical errors
    polynomial_product = np.round(polynomial_product[:N]).astype(int)

    return polynomial_product

# Example polynomials (coefficients)
polynomial1 = np.array([1, 2, 3])  # 1 + 2x + 3x^2
polynomial2 = np.array([2, 3, 4])  # 2 + 3x + 4x^2

# Compute the product of the polynomials using FFT
product = fft_multiply_polynomials(polynomial1, polynomial2)
print("Product of polynomials:", product)